# 110/7開始預售屋備查：預售屋備查是指建商在銷售預售屋前，必須將建案的相關資訊（如基地位置、建案名稱、銷售地點、期間、戶數等）以及預售屋買賣定型化契約，向預售屋所在地的主管機關（通常是地方政府的地政局或地政處）進行申報，並取得備查，才能開始銷售。 這項制度的目的在於保障消費者權益，讓消費者在購買預售屋前，能更清楚了解建案資訊，並確保契約內容符合相關法規
